function data () {
     getWorldData=async()=>{
        const fetcher = await fetch('https://nprelease.indiatimes.com/ncov19/trend_data_toi.json')
        const response = await fetcher.json()
        return response;
    },

    //fetch data for region India
     getIndiaData=async()=>{
        const fetcher =await fetch("https://nprssfeeds.indiatimes.com/ncov19/trend_data_india_toi.json")
        const response = await fetcher.json()
        return response;
    }
}

export default data
